import { useEffect, useState, useCallback } from 'react';
import { Link } from 'react-router-dom';
import { 
  usersList,
  sessionsList,
  sessionsSummary
} from '../../services/api';
import { 
  IconUsers as UsersIcon, 
  IconCalendar as CalendarIcon, 
  IconTools as ToolsIcon, 
  IconFeedback as FeedbackIcon, 
  IconEye as ActivityIcon,
  IconRefresh as RefreshIcon,
  IconSearch as SearchIcon,
  IconArrowRight as ArrowRightIcon
} from '../../components/Icons';
import '../../styles/dashboard.css';

// Helper function to format relative time
const formatRelativeTime = (dateString) => {
  const date = new Date(dateString);
  const now = new Date();
  const diffInSeconds = Math.floor((now - date) / 1000);

  if (diffInSeconds < 60) return 'just now';
  if (diffInSeconds < 3600) return `${Math.floor(diffInSeconds / 60)} mins ago`;
  if (diffInSeconds < 86400) return `${Math.floor(diffInSeconds / 3600)} hours ago`;
  if (diffInSeconds < 604800) return `${Math.floor(diffInSeconds / 86400)} days ago`;
  return date.toLocaleDateString();
};

const MetricCard = ({ icon, title, value = 0, change, isIncrease }) => (
  <div className="metric-card">
    <div className="metric-icon">{icon}</div>
    <div className="metric-content">
      <div className="metric-title">{title}</div>
      <div className="metric-value">
        {typeof value === 'number' ? value.toLocaleString() : '0'}
      </div>
      {change !== undefined && (
        <div className={`metric-change ${isIncrease ? 'increase' : 'decrease'}`}>
          {isIncrease ? 'â†‘' : 'â†“'} {change}% from last month
        </div>
      )}
    </div>
  </div>
);

export default function AdminDashboard() {
  const [metrics, setMetrics] = useState({
    totalUsers: 0,
    activeSessions: 0,
    totalSessions: 0,
    totalBookings: 0,
    totalTools: 0,
  });

  const [recentSessions, setRecentSessions] = useState([]);
  const [loading, setLoading] = useState(true);

  const fetchDashboardData = useCallback(async () => {
    try {
      setLoading(true);

      // Fetch all data in parallel
      const [users, sessions, summary] = await Promise.all([
        usersList(),
        sessionsList({ page: 1, pageSize: 10, status: 'Active' }), // Only show active sessions
        sessionsSummary(),
      ]);

      // Get the current user from local storage
      const currentUser = JSON.parse(localStorage.getItem('user') || '{}');
      console.log('Current user from localStorage:', currentUser);

      const usersData = users.users || [];
      const sessionsData = sessions.items || [];
      const summaryData = summary || {};

      // Log detailed user and session info for debugging
      console.log('All users:', usersData);
      console.log('Current sessions:', sessionsData);

      // Update metrics with fallback to 0 for all values
      setMetrics({
        totalUsers: usersData?.length || 0,
        activeSessions: summaryData?.active || 0,
        totalSessions: summaryData?.total || 0,
        totalBookings: 0, // You'll need to implement this if needed
        totalTools: 0,    // You'll need to implement this if needed
      });

      // Format recent sessions with proper user identification and status
      const formattedSessions = sessionsData.map(session => {
        try {
          // Get user details with proper fallbacks
          const userData = session.user || {};
          const userId = userData._id || session.userId || 'unknown';

          // Get user info with fallbacks
          const userEmail = (userData.email || '').toLowerCase();
          const userName = userData.name || userEmail.split('@')[0] || 'User';

          // Get role - prioritize session role, then user role, then check email for admin
          let role = session.role || userData.role || 'member';

          // Enhanced role detection - check email and name for admin indicators
          if (userEmail === 'admin@example.com' || 
              userEmail.includes('admin') || 
              userName.toLowerCase().includes('admin')) {
            role = 'admin';
          }

          // Set display name with appropriate emoji based on role
          let displayName = '';
          switch(role.toLowerCase()) {
            case 'admin':
              displayName = `ðŸ‘‘ ${userName}`;
              break;
            case 'manager':
              displayName = `ðŸ‘” ${userName}`;
              break;
            default:
              displayName = `ðŸ‘¤ ${userName}`;
          }

          // Calculate session status - more accurate status detection
          const lastActive = session.lastActive ? new Date(session.lastActive) : new Date(session.createdAt || new Date());
          const fifteenMinutesAgo = new Date(Date.now() - 15 * 60 * 1000);

          // Check if session is active based on multiple factors
          let isActive = false;
          if (session.status) {
            isActive = session.status.toLowerCase() === 'active' && lastActive > fifteenMinutesAgo;
          } else {
            // If no explicit status, use last activity time
            isActive = lastActive > fifteenMinutesAgo;
          }

          // Get action based on session type if available
          const action = session.action || (isActive ? 'is active' : 'was active');

          // Get the current user from localStorage for comparison
          const currentUser = JSON.parse(localStorage.getItem('user') || '{}');
          const isCurrentUser = currentUser && (currentUser._id === userId || 
                                              currentUser.email?.toLowerCase() === userEmail);

          // If this is the current user's session, ensure it shows as active
          if (isCurrentUser) {
            isActive = true;
            role = currentUser.role || role; // Use the role from current session
          }

          return {
            id: session._id || `session-${Math.random().toString(36).substr(2, 9)}`,
            user: displayName,
            action: action,
            time: formatRelativeTime(lastActive),
            status: isActive ? 'active' : 'offline',
            role: role,
            lastActive: lastActive,
            isCurrentUser: isCurrentUser, // Add flag for current user
            rawData: session // Keep original data for debugging
          };
        } catch (error) {
          console.error('Error processing session:', error, session);
          return null;
        }
      });

      // Filter out any null sessions and sort by lastActive in descending order (newest first)
      const validSessions = formattedSessions.filter(session => session !== null);
      validSessions.sort((a, b) => b.lastActive - a.lastActive);

      // Log the processed sessions for debugging
      console.log('Processed sessions:', validSessions);

      setRecentSessions(validSessions);
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    fetchDashboardData();
  }, [fetchDashboardData]);

  const handleRefresh = async () => {
    setLoading(true);
    try {
      await fetchDashboardData();
    } catch (error) {
      console.error('Error refreshing data:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <div className="flex items-center gap-4">
          <h1>Dashboard</h1>
          <button 
            onClick={handleRefresh}
            className="p-2 rounded-full hover:bg-gray-100 transition-colors"
            disabled={loading}
            title="Refresh data"
          >
            <svg 
              className={`w-5 h-5 ${loading ? 'animate-spin' : ''}`} 
              fill="none" 
              viewBox="0 0 24 24" 
              stroke="currentColor"
            >
              <path 
                strokeLinecap="round" 
                strokeLinejoin="round" 
                strokeWidth={2} 
                d="M4 4v5h.582m15.356 2A8.001 8.001 0 004.582 9m0 0H9m11 11v-5h-.581m0 0a8.003 8.003 0 01-15.357-2m15.357 2H15" 
              />
            </svg>
          </button>
        </div>
      </div>

      <div className="metrics-grid">
        <MetricCard 
          icon={<UsersIcon size={24} />} 
          title="Total Users" 
          value={metrics.totalUsers} 
        />
        <MetricCard 
          icon={<ActivityIcon size={24} />} 
          title="Active Sessions" 
          value={metrics.activeSessions}
        />
        <MetricCard 
          icon={<CalendarIcon size={24} />} 
          title="Total Sessions" 
          value={metrics.totalSessions}
        />
        <MetricCard 
          icon={<ToolsIcon size={24} />} 
          title="Active Now" 
          value={metrics.activeSessions}
        />
      </div>

      <div className="card" style={{ marginBottom: '32px' }}>
        <div className="section-header" style={{ padding: '16px 24px', borderBottom: '1px solid #e5e7eb', display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
          <h2 style={{ margin: 0 }}>Recent Activity</h2>
          <button className="btn" onClick={handleRefresh} disabled={loading}>
            <RefreshIcon size={16} style={{ marginRight: '8px' }} /> Refresh
          </button>
        </div>
        <div className="table-wrap" style={{ overflowX: 'auto' }}>
          <table className="table" style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr style={{ backgroundColor: '#f9fafb', borderBottom: '1px solid #e5e7eb' }}>
                <th style={{ padding: '16px 24px', textAlign: 'left', fontWeight: 600, color: '#4b5563' }}>Username</th>
                <th style={{ padding: '16px 24px', textAlign: 'left', fontWeight: 600, color: '#4b5563' }}>Email</th>
                <th style={{ padding: '16px 24px', textAlign: 'left', fontWeight: 600, color: '#4b5563' }}>Login Time</th>
                <th style={{ padding: '16px 24px', textAlign: 'left', fontWeight: 600, color: '#4b5563' }}>Logout Time</th>
                <th style={{ padding: '16px 24px', textAlign: 'left', fontWeight: 600, color: '#4b5563' }}>Duration</th>
                <th style={{ padding: '16px 24px', textAlign: 'left', fontWeight: 600, color: '#4b5563' }}>Status</th>
              </tr>
            </thead>
            <tbody>
              {recentSessions.map((session) => {
                if (!session) return null;

                // Get session data with fallbacks
                const username = session.username || 'Unknown';
                const email = session.email || 'N/A';
                const loginTime = session.loginAt || new Date();
                const isActive = session.status === 'Active';

                // Format duration
                const formatDuration = (sec) => {
                  if (!sec && sec !== 0) return '-';
                  if (sec < 60) return `${sec}s`;
                  const mins = Math.floor(sec / 60);
                  const secs = sec % 60;
                  return `${mins}m ${secs}s`;
                };

                return (
                  <tr key={session._id} style={{ borderBottom: '1px solid #f3f4f6' }}>
                    <td style={{ padding: '16px 24px' }}>{username}</td>
                    <td style={{ padding: '16px 24px' }}>{email}</td>
                    <td style={{ padding: '16px 24px' }}>{new Date(loginTime).toLocaleString()}</td>
                    <td style={{ padding: '16px 24px' }}>{session.logoutAt ? new Date(session.logoutAt).toLocaleString() : '-'}</td>
                    <td style={{ padding: '16px 24px' }}>{formatDuration(session.durationSec)}</td>
                    <td style={{ padding: '16px 24px' }}>
                      <span style={{
                        display: 'inline-block',
                        padding: '4px 12px',
                        borderRadius: '9999px',
                        fontSize: '0.75rem',
                        fontWeight: 600,
                        backgroundColor: isActive ? '#dcfce7' : '#f3f4f6',
                        color: isActive ? '#166534' : '#4b5563'
                      }}>
                        {isActive ? 'Active' : 'Logged Out'}
                      </span>
                    </td>
                  </tr>
                );
              })}
              {recentSessions.length === 0 && (
                <tr>
                  <td colSpan="6" style={{ textAlign: 'center', padding: '24px', color: '#6b7280' }}>
                    No recent activity found
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>

      <div className="dashboard-section">
        <div className="section-header">
          <h2>Sessions Overview</h2>
          <div className="time-filter">
            <button className="btn-text active">Today</button>
            <button className="btn-text">Week</button>
            <button className="btn-text">Month</button>
          </div>
        </div>
        <div className="sessions-chart">
          <div className="chart-placeholder">
            <p>Sessions chart will be displayed here</p>
          </div>
        </div>
      </div>
    </div>
  );
}
